import { Box, Button, Paper, Stack, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const NotFound = () => {
  const navigate = useNavigate();

  return (
    <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'radial-gradient(circle at top, rgba(29,185,84,0.12), rgba(15,15,15,0.94) 55%)',
        px: 2
      }}
    >
      <Paper
        elevation={0}
        sx={{
          maxWidth: 560,
          width: '100%',
          p: { xs: 4, md: 6 },
          borderRadius: 5,
          backdropFilter: 'blur(18px)',
          background: 'linear-gradient(135deg, rgba(21,21,21,0.92), rgba(12,12,12,0.88))',
          border: '1px solid rgba(255,255,255,0.08)',
          boxShadow: '0 24px 48px rgba(0,0,0,0.4)'
        }}
      >
        <Stack spacing={3} alignItems="flex-start">
          <Typography
            variant="overline"
            color="rgba(255,255,255,0.6)"
            letterSpacing={4}
          >
            error 404
          </Typography>
          <Typography variant="h3" sx={{ fontWeight: 700, lineHeight: 1.1 }}>
            This page drifted off beat
          </Typography>
          <Typography variant="body1" color="text.secondary">
            The track you were hunting for isn't here. Let's drop back to the home stage and keep the mix going.
          </Typography>
          <Button
            variant="contained"
            color="primary"
            onClick={() => navigate('/')}
            sx={{ mt: 1 }}
          >
            Back to Home
          </Button>
        </Stack>
      </Paper>
    </Box>
  );
};

export default NotFound;
